
ADDRESS=$(erdpy data load --key=address-testnet)
DWALLET_PEM="delegationWalletKey.pem"
DWALLET="erd1vxy22x0fj4zv6hktmydg8vpfh6euv02cz4yg0aaws6rrad5a5awqgqky80"
DELEGATION_SC="erd1qqqqqqqqqqqqqpgqrchxzx5uu8sv3ceg8nx8cxc0gesezure5awqn46gtd"
DEPLOY_TRANSACTION=$(erdpy data load --key=deployTransaction-testnet)
DEPLOY_GAS="800000000"
PROXY="http://35.217.24.225:8080"

deploy_lvl2() {
    erdpy --verbose contract deploy --recall-nonce \
          --pem=${DWALLET_PEM} \
          --gas-limit=${DEPLOY_GAS} \
          --proxy=${PROXY} --chain="1" \
          --bytecode="../v0_5_x_full/output/delegation_v0_5_x_full.wasm" \
          --outfile="deploy-internal.interaction.json" --send || return

    TRANSACTION=$(erdpy data parse --file="deploy-internal.interaction.json" --expression="data['emitted_tx']['hash']")
    ADDRESS=$(erdpy data parse --file="deploy-internal.interaction.json" --expression="data['emitted_tx']['address']")

    erdpy data store --key=address-devnet --value=${ADDRESS}
    erdpy data store --key=deployTransaction-devnet --value=${TRANSACTION}

    echo ""
    echo "Smart contract address: ${ADDRESS}"
}

upgrade() {
    erdpy --verbose contract upgrade ${DELEGATION_SC} --recall-nonce \
          --pem=${DWALLET_PEM} \
          --gas-limit=${DEPLOY_GAS} \
          --proxy=${PROXY} --chain="1" \
          --bytecode="../../../v0_5_x_update/output/delegation_v0_5_x_update.wasm" \
          --outfile="deploy-internal.interaction.json" --send || return
}

upgrade_change_user() {
    erdpy --verbose contract upgrade ${DELEGATION_SC} --recall-nonce \
          --pem=${DWALLET_PEM} \
          --gas-limit=${DEPLOY_GAS} \
          --proxy=${PROXY} --chain="1" \
          --bytecode="../../../v0_5_x_update/output/delegation_v0_5_x_update.wasm" \
          --arguments "0x1626a99f1ab7c17e894687a9a8503897f62cb492ca69f56a6703f475aaf40d28" "0xebfd923cd251f857ed7639e87143ac83f12f423827abc4a0cdde0119c3e37915" \
          --outfile="deploy-internal.interaction.json" --send || return
}

